interface Coordinate {
  xmax: Object;
  xmin: Object;
  ymax: Object;
  ymin: Object;
  length: number;
}

type Canvas = {
  canvRef: any;
  zindex: number;
  loc: Coordinate | undefined;
};

const CanvasComponent: React.FC<Canvas> = ({ canvRef, zindex, loc }) => {
  if (loc && loc.xmax.length > 0) {
    console.log(loc.xmax[0]);
  }
  return (
    <canvas
      ref={canvRef}
      style={{
        position: "absolute",
        marginLeft: "auto",
        marginRight: "auto",
        left: 0,
        right: 0,
        width: 640,
        height: 480,
        zIndex: zindex,
      }}
    />
  );
};

export default CanvasComponent;
